var baseUrl = document.getElementById("ModeloAnamneseController").value + "/";
var modeloAnamneses = document.getElementById("ModeloAnamneses");
var anotacaoEspecialista = document.getElementById("anotacaoEspecialista");
var nomePaciente = document.getElementById("lblPaciente");
var btnImprimir = document.getElementById("btnImprimir");

modeloAnamneses.addEventListener('change', function (event) {
    fnGetModeloAnmnese(modeloAnamneses.selectedIndex);
});

function fnGetModeloAnmnese(id) {

    if (id != "-1") {
        var util = new Util();
        var method = 'GetModeloAnamneseById';
        var params = "{id:'" + id + "'}";

        util.doAjax(baseUrl + method, params).then(function (data) {
            anotacaoEspecialista.value = data.Modelo;
        }), function (err) { consoleg.log(err) };
    }
}

btnImprimir.addEventListener('click', function (event) {
    event.preventDefault();
    createPDF();
});

$(function () {

    var medicamentos = [];
    var method = "GetMedicamentos";
    var util = new Util();

    util.doAjax(baseUrl + method).then(function (data) {
        for (var i = 0; i < data.length; i++) {
            medicamentos.push(data[i]);
        }
    }, function (err) { console.log(err) });

    $("#txtMedicamentos").autocomplete({
        source: medicamentos,
        minLength: 3
    });

    $("#btnAdicionar").click(function () {
        $("#txtmedicamentos").val($("#txtmedicamentos").val() + $("#txtMedicamentos").val() + "\n");
    });

});


function createPDF() {
    var data = new Date();
    var dia = data.getDate() > 9 ? data.getDate() : "0" + data.getDate();
    var mes = data.getMonth() > 9 ? (data.getMonth() + 1) : "0" + (data.getMonth() + 1);
   
    var docDefinition = {
        compress: false,
        content:
            [
                { text: dia + "/" + mes  + "/" + data.getFullYear(), alignment: 'right', margin: [0, 0, 0, 0], fontSize: 10, bold: false },
                {

                    image: "data:image/png;base64,",
                    width: 72,
                    height: 52,
                    alignment: "center"

                },
                {
                    columns: [

                        {
                            fontSize: 10,
                            text: 'Clínica Santa Rita', style: 'header', alignment: 'center', bold: false, margin: [20, 2, 10, 20], fontSize: 14
                        }
                    ]
                },
                { canvas: [{ type: 'rect', x: 0, y: 0, w: 510, h: 10, color: "#F0F0F0" }] },
                { text: "Paciente: " + $('#lblPaciente').text(), alignment: 'left', margin: [5, 10, 0, 0], fontSize: 12, bold: false },
                { text: "Especialidade: " + $('#lblEspecialidade').text(), alignment: 'left', margin: [5, 2, 0, 0], fontSize: 12, bold: false },
                 { text: "Especialista: " + $('#lblEspecialista').text(), alignment: 'left', margin: [5, 2, 0, 0], fontSize: 12, bold: false },
                { canvas: [{ type: 'rect', x: 0, y: 10, w: 510, h: 10, color: "#F0F0F0" }] },
                { text: "Prescrição Médica", alignment: 'center', margin: [5, 5, 0, 0], fontSize: 13, bold: true },
                {
                    table: {

                        widths: [500],
                        heights: [480],
                        body: [
                                [$("#txtmedicamentos").val()],
                        ]
                    }
                },
                {
                    canvas: [{
                        type: 'line',
                        x1: 0, y1: 38,
                        x2: 510, y2: 38,
                        lineWidth: 0.8,
                        margin: [0, 0, 0, 5]
                    }]
                },
                { text: "Médico(a)", alignment: 'center', margin: [0, 10, 0, 0], fontSize: 13, bold: true },
            ]
    };

    // Faz o download
    pdfMake.createPdf(docDefinition).download(nomePaciente.innerHTML + '.pdf')

}